import React from "react";

import "./NavBar.css";

const NavBar = () => {
  const navBarList = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  return (
    <ul>
      {navBarList.map((item) => {
        <li>
          <i>{item.icon}</i>
          <p>{item.type}</p>
        </li>;
      })}
    </ul>
  );
};

export default NavBar;
